import React, { Component } from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import Customers from "./components/Customers"
import './App.css';



class App extends Component {

    render(){
        return(
            <Router>
                <Switch>
                    <Route path="/customers">
                        <Customers />
                    </Route>
                </Switch>
            </Router>
        );
    }

}

export default App;
